import React, { useState } from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  useNavigate,
  useParams
} from "react-router-dom";

import Home from "./component/Home";
import Login from "./component/Login";
import AddEvent from "./component/AddEvent";
import UpdateEvent from "./component/UpdateEvent";
import EventDetails from "./component/EventDetails";
import { getReport } from "./api";
import "./styles.css";

function App() {
  const [user, setUser] = useState(null);

  const handleLogout = () => {
    setUser(null);
  };

  // route wrapper components so we can use hooks and also pass props to the original components
  function HomeWrapper() {
    const navigate = useNavigate();

    const handleAddEvent = () => navigate("/add");
    const handleEditEvent = (id) => navigate(`/update/${id}`);
    const handleOpenEvent = (id) => navigate(`/event/${id}`);
    const handleReport = async (id) => {
      try {
        const r = await getReport(id);
        // simple inline display — you can replace with a better UI
        alert(JSON.stringify(r, null, 2));
      } catch (err) {
        console.error(err);
        alert("रिपोर्ट लाना विफल रहा");
      }
    };

    return (
      <Home
        user={user}
        onLogout={handleLogout}
        onAdd={handleAddEvent}
        onEdit={handleEditEvent}
        onOpen={handleOpenEvent}
        onReport={handleReport}
      />
    );
  }

  function LoginWrapper() {
    const navigate = useNavigate();
    const onLogin = (loggedUser) => {
      setUser(loggedUser);
      navigate("/");
    };
    return <Login onLogin={onLogin} />;
  }

  function AddWrapper() {
    const navigate = useNavigate();
    const onBack = () => navigate(-1);
    return <AddEvent user={user} onBack={onBack} />;
  }

  function UpdateWrapper() {
    const { id } = useParams();
    const navigate = useNavigate();
    const onBack = () => navigate(-1);
    return <UpdateEvent id={id} user={user} onBack={onBack} />;
  }

  function EventWrapper() {
    const { id } = useParams();
    const navigate = useNavigate();
    const onBack = () => navigate(-1);
    const onEdit = (editId) => navigate(`/update/${editId}`);
    return <EventDetails id={id} user={user} onBack={onBack} onEdit={onEdit} />;
  }

  return (
    <Router>
      <div className="app">
        <header className="header">
          <h1>INC Event Management</h1>
          <nav style={{ marginLeft: "auto" }}>
            <Link className="button" to="/">
              Home
            </Link>
            <Link className="button" to="/add">
              Add Event
            </Link>
            {user ? (
              <button className="button secondary" onClick={handleLogout}>
                Logout
              </button>
            ) : (
              <Link className="button" to="/login">
                Login
              </Link>
            )}
          </nav>
        </header>

        <main>
          <Routes>
            <Route path="/" element={<HomeWrapper />} />
            <Route path="/login" element={<LoginWrapper />} />
            <Route path="/add" element={<AddWrapper />} />
            <Route path="/update/:id" element={<UpdateWrapper />} />
            <Route path="/event/:id" element={<EventWrapper />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
